/* eslint-disable @typescript-eslint/no-unused-vars */
import { PhotoCameraRounded } from "@mui/icons-material";
import { Box, Card, CardContent, IconButton, Typography } from "@mui/material";
import { useMutation, useQuery } from "@tanstack/react-query";
import { useRef } from "react";
import { Image, ImageCreate, getImages, postImage, postImageOffline } from "../api/api";
import { queryClient } from "../main";

function TakePhoto() {
    const photoTakenInputRef = useRef<HTMLInputElement | null>(null);

    const handleTakePhoto = (inputRef: React.RefObject<HTMLInputElement>) => {
        if (inputRef.current) {
            inputRef.current.click();
        }
    };

    // Fetch Images
    const { data, isLoading } = useQuery<Image[]>({
        queryKey: ['images'],
        queryFn: getImages,
    });

    const mutation = useMutation({
        mutationKey: ['images'],
        mutationFn: postImage,
        onMutate: async (payload: ImageCreate) => {
            postImageOffline(payload);
        },
        onSuccess: () => {
            queryClient.invalidateQueries({ queryKey: ['images'] });
        },
        onError: () => {
            // Rollback to the previous value
            queryClient.invalidateQueries({ queryKey: ['images'] });
        },
    });

    // we need a default mutation function so that paused mutations can resume after a page reload
    queryClient.setMutationDefaults(['images'], {
        mutationFn: async (newImage: ImageCreate) => {
            // to avoid clashes with our optimistic update when an offline mutation continues
            console.log('canceling queries')
            await queryClient.cancelQueries({ queryKey: ['images'] })
            return postImage(newImage)
        },
    })

    // const convertToBase64 = async (file: File) => {
    //     const reader = new FileReader();
    //     reader.readAsDataURL(file);
    //     return new Promise((res) => {
    //         reader.onloadend = () => {
    //             res(reader.result);
    //         }
    //     })

    // }

    const handleFileChange = async (event: React.ChangeEvent<HTMLInputElement>) => {
        const files = event.target.files;
        if (files) {
            try {
                const firstFile = files[0];
                mutation.mutate(
                    {
                        title: firstFile.name,
                        photoURL: URL.createObjectURL(firstFile),
                        file: firstFile,
                        base64: 'data:image/png;base64,',
                    }
                );

            } catch (error) {
                console.log('failed adding photo');
            }
        }
    };

    return (
        <Card>
            <CardContent>
                <input
                    type="file"
                    accept="image/*"
                    capture="environment"
                    onChange={handleFileChange}
                    ref={photoTakenInputRef}
                    style={{ display: 'none' }}
                />
                <Box display="flex" flexDirection="column" alignItems="center">
                    <IconButton color="inherit" aria-label="take photo" onClick={() => handleTakePhoto(photoTakenInputRef)}>
                        <PhotoCameraRounded fontSize="large" />
                    </IconButton>
                    <Typography variant="body1">Take Photo</Typography>
                    {isLoading && <Typography variant="body1">Loading Images...</Typography>}

                    {data?.map((image, index) => (
                        <li key={index} style={{ margin: '2px' }}>
                            <button color="inherit" aria-label="delete" onClick={() => window.open(image.photoURL, '_blank')}>
                                {image.title}
                            </button>
                        </li>
                    ))}
                </Box>
            </CardContent>
        </Card>
    );

}

export default TakePhoto;